import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import YieldForm from "./YieldForm";
import HistoryPage from "./historypage";

function App() {
  return (
    <Router>
      <nav style={{
        background: "#2b6cb0",
        padding: "10px",
        color: "#fff",
        display: "flex",
        justifyContent: "space-around",
      }}>
        <Link to="/" style={{ color: "white", textDecoration: "none", fontWeight: "bold" }}>Predict Yield</Link>
        <Link to="/history" style={{ color: "white", textDecoration: "none", fontWeight: "bold" }}>Prediction History</Link>
      </nav>

      <Routes>
        <Route path="/" element={<YieldForm />} />
        <Route path="/history" element={<HistoryPage />} />
      </Routes>
    </Router>
  );
}

export default App;
